import "./App.css";
import Menu from "./components/Menu";

import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";
import Container from "react-bootstrap/Container";

function App() {
  return (
    <Router>
      <div className="App">
        <Container>
          <Menu></Menu>
        </Container>

        <Switch>
          <Route path="/about">
            <About />
          </Route>
          <Route path="/users">
            <Users />
          </Route>
          <Route path="/">
            <Home />
          </Route>
        </Switch>
      </div>
    </Router>
  );
}

export default App;
